import React, { useState } from "react";

import "./RentaForm.css";

const RentaFormActualizar = (props) => {
    const [idRentar, setIdRentar] = useState("");
    const [idUsuario, setIdUsuario] = useState("");
    const [idPelicula, setIdPelicula] = useState("");
    const [fechaRenta, setFechaRenta] = useState("");
    const [diasRenta, setDiasRenta] = useState("");
    const [estatus, setEstatus] = useState(false);

    const [idActualizar,setIdActualizar] = useState("");

    const setIdRentarHandler = (event) => {
        setIdRentar(event.target.value);
    };

    const buscarHandler = (event) => {
        event.preventDefault();

        setIdActualizar(idRentar);
        setIdRentar(event.target.value);
        const indice = props.rentas.findIndex(renta => renta.idRentar === parseInt(idRentar));
        const rent = props.rentas[indice];
        if (!rent){
            alert("ID no encontrado");
            setIdRentar("");
            setIdUsuario("");
            setIdPelicula("");
            setFechaRenta("");
            setDiasRenta("");
            setEstatus(false);
            setIdActualizar("");
            return;
        }
        setIdRentar(rent.idRentar);
        setIdUsuario(rent.idUsuario);
        setIdPelicula(rent.idPelicula);
        setFechaRenta(rent.fechaRenta);
        setDiasRenta(rent.diasRenta);
        setEstatus(rent.estatus);
    }

    const setIdUsuarioHandler = (event) => {
        setIdUsuario(event.target.value);
    };

    const setIdPeliculaHandler = (event) => {
        setIdPelicula(event.target.value);
    };

    const setFechaRentaHandler = (event) => {
        setFechaRenta(event.target.value);
    };

    const setDiasRentaHandler = (event) => {
        setDiasRenta(event.target.value);
    };

    const setEstatusHandler = (event) => {
        setEstatus(event.target.checked);
    };

    const setIdActualizarHandler = (event) => {
        setIdActualizar(event.target.checked);
    };

    const submitHandler = (event) => {
        event.preventDefault();

        const indice = props.rentas.findIndex(r => r.idRentar === parseInt(idRentar));
        if (indice === -1) {
            alert("ID no elegido");
            return;
        }

        const renta = {
            idRentar: parseInt(idRentar),
            idUsuario: idUsuario,
            idPelicula: idPelicula,
            fechaRenta: fechaRenta,
            diasRenta: diasRenta,
            estatus: estatus,
        };

        if (
            false
        ) {
            alert("Campos vacÃ­os!!");
            return;
        }

        props.actualizarRenta(renta);
        setIdRentar("");
        setIdUsuario("");
        setIdPelicula("");
        setFechaRenta("");
        setDiasRenta("");
        setEstatus(false);
        setIdActualizar("");
    };

    return (
        <form onSubmit={submitHandler}>

        <label>ID: </label>
        <input type="number" value={idRentar} min="0" onChange={setIdRentarHandler}/>
        <button className="button" onClick={buscarHandler}>Buscar</button>
        <br />
        <br />

        <a>ID de la Renta a Actualizar: {idActualizar}</a>
        <br />
        <br />

        <label>ID Usuario: </label>
        <input type="number" value={idUsuario} onChange={setIdUsuarioHandler} required/>
        <a class="red-text"> *</a>
        <br />

        <label>ID PelÃ­cula: </label>
        <input type="number" value={idPelicula} onChange={setIdPeliculaHandler} required/>
        <a class="red-text"> *</a>
        <br />

        <label>Fecha Renta: </label>
        <input type="date" value={fechaRenta} onChange={setFechaRentaHandler} required/>
        <a class="red-text"> *</a>
        <br />

        <label>DÃ­as de Renta: </label>
        <input type="number" value={diasRenta} onChange={setDiasRentaHandler} />
        <br />

        <label>Estatus: </label>
        <input type="checkbox" checked={estatus} onChange={setEstatusHandler} />
        <br />

        <button className="button" type="submit">Actualizar Renta</button>

        </form>
        );
    };

export default RentaFormActualizar;
